window.bookSummaryJSON = "<p>Raiders stole his childhood. It's time Corin made them pay.</p> <p>When his parents are murdered, and his sister taken by raiders, Corin's world crashes in on him. Wild and willful, he joins the elite Wolf Regiment but swiftly falls foul of its swordmaster, the brutal Taskala.</p> <p>The regiment becomes embroiled in a vicious civil war between the sultan of Permio and rebel tribesmen. Corin, caught in the treacherous power play between rival factions and corrupt leaders, struggles to survive. Torn between his quest for vengeance and growing hatred for the sadistic Taskala, Corin has to intervene when the woman he loves becomes the latest target of Taskala's wrath.</p> <p><i>Gray Wolf</i> is the first book in a trilogy featuring Corin an Fol, a man chosen by the gods to walk a dark path. The novel forms part of the Legends of Ansu, a spellbinding fantasy series. If you like tough action featuring gritty characters set to a vivid fantasy backdrop of war, and vengeance, then you are going to love this new tale by JW Webb.</p> <p>Get your copy of <i>Gray Wolf</i> to beginlistening to this exciting series today!</p>"; 
